* {
  padding: 0;
  margin: 0;
  text-decoration: none;
  list-style: none;
  color: #01579b;
}
html {
  font-family: 'Source Sans Pro', sans-serif;
  font-size: 16px;
}
.navbar {
  position: fixed;
  top: 0;
  background-color: #e1f5fe;
  width: 100%;
}
.navbar__list {
  display: flex;
  justify-content: space-between;
}
.navbar__list__item {
  padding: 1rem;
}
.navbar__list__item__link {
  transition: color 0.3s ease-in-out;
}
.navbar__list__item__link:hover {
  color: #039be5;
}
main .hello {
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 1.5rem;
  background-color: #e1f5fe;
}
main .hello__message__text {
  color: #0277bd;
}
main .projects {
  background-color: #fff;
  display: flex;
  flex-direction: column;
  justify-content: center;
}
main .projects__header {
  font-size: 3rem;
}
